import React from "react";
import styles from "/Icon.module.css";

import Image from "next/image";

import "./Icon.scss";

export const Icon = () => {
  return (
    <div className="icon">
      <Image src="/fotoAlex.jpg" alt="PPPP" layout="fill" />
      <p>Arriba se encuentra una imagen</p>
    </div>
  );
};
